import React from 'react';
import Plant from './plant';

function PlantList({plants}) {
    return (
        <table id="plants">
            <thead>
                <tr>
                    <th>Name</th>
                    <th>Details</th>
                    <th>Planting</th>
                    <th>Harvesting</th>
                </tr>
            </thead>
            <tbody>
                {() => plants(
                    console.table(plants)
                  )};
                  {plants.map((plant) => {
                    return (
                      <tr key={plant.id}>
                        <td>{plant.name}</td>
                        <td>{plant.details}</td>
                        <td>{plant.planting}</td>
                        <td>{plant.harvesting}</td>
                    </tr>
                    );
                  })}
            </tbody>
        </table>
    );
}

export default PlantList;
